import React, { useState } from "react";
import Navbar from "../components/Navbar";
import MovieTendance from "../components/MovieTendance";
import ArtistesTendance from "../components/ArtistesTendance";
import SeriesTendances from "../components/SeriesTendances";
import InputSearchAcc from "../components/InputSearchAcc";
const Acceuil = () => {
  const [inputSearch, setInputSearch] = useState("");
  return (
    <div className="acceuil">
      <Navbar inputSearch={inputSearch} />
      <div className="img-acceuil">
        <img src="./img/interstelar.jpeg" alt="" />
        <h3>
          <span>Bienvenue,</span>
          <br />
          Des millions de films, émissions télévisées et artistes...
        </h3>
        <div className="search-container">
          <input
            className="search"
            type="text"
            placeholder="Rechercher un film une série ou un artiste ..."
            onChange={(e) => setInputSearch(e.target.value)}
          />
          <InputSearchAcc inputSearch={inputSearch} />
        </div>
      </div>
      <MovieTendance />
      <SeriesTendances />
      <ArtistesTendance />
    </div>
  );
};

export default Acceuil;
